import React from 'react';

import Nav from './components/Nav'
import Todo from './components/Todo'

function App() {
  const containerStyle = {
    width: '50%',
    margin: '0 auto'
  }
  return (
    <div style={{containerStyle}} className="App container-fluid">
       <Nav />
       <Todo />
    </div>
  );
}

export default App;
